/* eslint-disable */
import axios from "axios";

function Search(breed, typeSelect, names) {
  const arr = names.split(" ");
  var output = "";

  async function getHTMLolive() {
    try {
      return await axios.get(
        "https://www.oliveyoung.co.kr/store/main/getEventList.do"
      );
    } catch (error) {
      console.log(error);
    }
  }

  for (var i in arr) {
    var queryWords = breed + " " + arr[i] + "\n";
    output += queryWords;
  }
  return output;
}

export default Search;
